import React, { Component } from "react";
import "./main.css";
import { BrowserRouter, Route, Link } from "react-router-dom";
export default class Survey1 extends Component {
  state = {
    name: "",
    PT: "",
    PN: "",
    gmail: "",
    address: "",
    in: "",
    major: "",
    NOU: "",
    degree: "",
    skills: "",
    profile: "",
    WE: "",
    JT: ""
  };
  handleName = e => {
    this.setState({
      name: e.target.value
    });
  };

  handlePT = e => {
    this.setState({
      PT: e.target.value
    });
  };
  handelPM = e => {
    this.setState({
      PN: e.target.value
    });
  };
  handelgmail = e => {
    this.setState({
      gmail: e.target.value
    });
  };
  handeladdress = e => {
    this.setState({
      address: e.target.value
    });
  };
  handelin = e => {
    this.setState({
      in: e.target.value
    });
  };
  handelmajor = e => {
    this.setState({
      major: e.target.value
    });
  };
  handelNOU = e => {
    this.setState({
      NOU: e.target.value
    });
  };
  handeldegree = e => {
    this.setState({
      degree: e.target.value
    });
  };
  handelskills = e => {
    this.setState({
      skills: e.target.value
    });
  };
  handelprofile = e => {
    this.setState({
      profile: e.target.value
    });
  };
  handelWE = e => {
    this.setState({
      WE: e.target.value
    });
  };
  handelJT = e => {
    this.setState({
      JT: e.target.value
    });
  };

  getLink = () => {
    var name = this.state.name;
    var PT = this.state.PT;
    var PN = this.state.PN;
    var Gmail = this.state.gmail;
    var Address = this.state.address;
    var In = this.state.in;
    var Major = this.state.major;
    var NOU = this.state.NOU;
    var Degree = this.state.degree;
    var Skills = this.state.skills;
    var Profile = this.state.profile;
    var WE = this.state.WE;
    var JT = this.state.JT;

    var fLink =
      "/res/" +
      name +
      "/" +
      PT +
      "/" +
      PN +
      "/" +
      Gmail +
      "/" +
      Address +
      "/" +
      In +
      "/" +
      Major +
      "/" +
      NOU +
      "/" +
      Degree +
      "/" +
      Skills +
      "/" +
      Profile +
      "/" +
      WE +
      "/" +
      JT;
    window.location.href = fLink;
  };
  render() {
    return (
      <div className="App-header">
        <p>Fill in the following survey</p>
        <input
          className="txtboxes"
          placeholder="Enter your name"
          onChange={this.handleName}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your Proffesional title"
          onChange={this.handelPT}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your Phone Number"
          onChange={this.handelPN}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your Gmial address"
          onChange={this.handelgmail}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your Address"
          onChange={this.handeladdress}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your IN"
          onChange={this.handelin}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your major"
          onChange={this.handelmajor}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter the name of ypur university"
          onChange={this.handelNOU}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your degree"
          onChange={this.handeldegree}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your skills"
          onChange={this.handelskills}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your Profile"
          onChange={this.handelprofile}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your work experience"
          onChange={this.handelWE}
        />
        <br />
        <input
          className="txtboxes"
          placeholder="Enter your job title"
          onChange={this.handeljt}
        />
        <br />
        <button className="button_a" onClick={this.getLink}>
          GO TO THE NEXT PAGE.
        </button>
      </div>
    );
  }
}
